import React, { Component } from "react";
import { Link } from "react-router-dom";

export class Home extends Component {
    constructor() {
        super()
        this.state = {
            latitude: 0,
            longitude: 0
        }

        this.onChange = (event) => {
            this.setState({
                latitude: event.target.value
            })
        }
    }

    render() {
        return (
            <div>
                <div>
                    <Link to={'/'}>Back</Link>
                </div>
                <div>
                    <label>

                    </label>
                </div>
            </div>
        )
    }
}
